message:
cc @admin
É fácil perceber quem é infiltrado:
- Eles não mudam de idéia;
- Eles ofendem o presidente;
- Tentam ressuscitar narrativas já desmontadas;
- Mesmo diante da verdade, eles não reconhecem que estão errados.

Ou essas pessoas estão sendo pagas para gerar confusão, ou só querem bagunça mesmo.

Pessoas assim não contribuem para o debate saudável de idéias. Cuide dos seus usuários banindo esses idiotas!
